// Create geofenced circles for each hotspot with a 5m radius
crimeHotspots.forEach(function(coords) {
    var circle = L.circle(coords, {
        color: "red",
        fillColor: "#f03",
        fillOpacity: 0.5,
        radius: 50 // 50 meters radius for each hotspot
    }).addTo(map);
    geoFences.push(circle);
});

// Function to check if user is inside any geofenced area
function isInsideGeofence(userLat, userLng) {
    return geoFences.some(function(circle) {
        var fenceLatLng = circle.getLatLng();
        var distance = map.distance([userLat, userLng], [fenceLatLng.lat, fenceLatLng.lng]);
        return distance <= circle.getRadius();
    });
}

// Function to track user location
function trackLocation() {
    if ("geolocation" in navigator) {
        navigator.geolocation.watchPosition(function (position) {
            var userLat = position.coords.latitude;
            var userLng = position.coords.longitude;

            console.log("User Location:", userLat, userLng);

            // Show user marker on the map
            L.marker([userLat, userLng]).addTo(map)
                .bindPopup("📍 You are here").openPopup();

            // Check if user is in danger zone
            if (isInsideGeofence(userLat, userLng)) {
                if (!inDangerZone) {
                    sendNotification("⚠️ Warning: You have entered a high-crime area!");
                    inDangerZone = true;
                }
            } else {
                if (inDangerZone) {
                    sendNotification("✅ You are out of danger.");
                    inDangerZone = false;
                }
            }
        }, function (error) {
            console.error("Error getting location:", error);
            alert("❌ Error: Please enable location services in your browser.");
        }, {
            enableHighAccuracy: true
        });
    } else {
        alert("❌ Your browser does not support geolocation.");
    }
}

// Function to send a browser notification
function sendNotification(message) {
    if (Notification.permission === "granted") {
        new Notification(message);
    } else if (Notification.permission !== "denied") {
        Notification.requestPermission().then(function (permission) {
            if (permission === "granted") {
                new Notification(message);
            }
        });
    }
}

// Request Location Permission on Page Load
document.addEventListener("DOMContentLoaded", function () {
    if (Notification.permission !== "granted") {
        Notification.requestPermission();
    }

    // Force browser to ask for location access
    navigator.geolocation.getCurrentPosition(function (position) {
        console.log("✅ Location access granted!");
        trackLocation(); // Start tracking
    }, function (error) {
        console.error("❌ Location access denied or error:", error);
        alert("❌ Please allow location access for geofencing to work.");
    }, {
        enableHighAccuracy: true
    });
});

// Function to get distance between two coordinates
function getDistance(lat1, lon1, lat2, lon2) {
    const R = 6371; // Earth radius in km
    const dLat = (lat2 - lat1) * (Math.PI / 180);
    const dLon = (lon2 - lon1) * (Math.PI / 180);
    const a = Math.sin(dLat / 2) * Math.sin(dLat / 2) +
              Math.cos(lat1 * Math.PI / 180) * Math.cos(lat2 * Math.PI / 180) *
              Math.sin(dLon / 2) * Math.sin(dLon / 2);
    const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1 - a));
    return R * c; // Distance in km
}

// Modify watchPosition to show alert only once
let safeZoneMessageShown = false;
navigator.geolocation.watchPosition(position => {
    const userLat = position.coords.latitude;
    const userLng = position.coords.longitude;

    let isInDanger = crimeHotspots.some(([lat, lng]) => {
        return getDistance(userLat, userLng, lat, lng) < 0.005; // ~500m radius
    });

    if (!safeZoneMessageShown) {
        let message = isInDanger ? "⚠️ You are in a high-crime area! Stay alert." : "✅ You are in a safe zone.";
        alert(message);
        safeZoneMessageShown = true;
    }
}, error => {
    console.error("Error getting location", error);
});

</script>
